(70, 1, '2018-07-05 13:50:26', '2018-07-05 10:50:26', '<h2>Кто мы</h2>\r\nНаш адрес сайта: http://wp.\r\n<h2>Какие персональные данные мы собираем и с какой целью</h2>\r\n<h3>Комментарии</h3>\r\nЕсли посетитель оставляет комментарий на сайте, мы собираем данные указанные в форме комментария, а также IP адрес посетителя и данные user-agent браузера с целью определения спама.\r\n\r\nАнонимизированная строка создаваемая из вашего адреса email (\"хеш\") может предоставляться сервису Gravatar, чтобы определить используете ли вы его. Политика конфиденциальности Gravatar доступна здесь: https://automattic.com/privacy/ . После одобрения комментария ваше изображение профиля будет видимым публично в контексте вашего комментария.\r\n<h3>Медиафайлы</h3>\r\nЕсли вы зарегистрированный пользователь и загружаете фотографии на сайт, вам возможно следует избегать загрузки изображений с метаданными EXIF, так как они могут содержать данные вашего месторасположения по GPS. Посетители могут извлечь эту информацию скачав изображения с сайта.\r\n<h3>Формы контактов</h3>\r\n<h3>Куки</h3>\r\nЕсли вы оставляете комментарий на нашем сайте, вы можете включить сохранение вашего имени, адреса email и вебсайта в куки. Это делается для вашего удобства, чтобы не заполнять данные снова при повторном комментировании. Эти куки хранятся в течение одного года.\r\n\r\nЕсли у вас есть учетная запись на сайте и вы войдете в неё, мы установим временный куки для определения поддержки куки вашим браузером, куки не содержит никакой личной информации и удаляется при закрытии вашего браузера.\r\n\r\nПри входе в учетную запись мы также устанавливаем несколько куки с данными входа и настройками экрана. Куки входа хранятся в течение двух дней, куки с настройками экрана - год. Если вы выберете возможность \"Запомнить меня\", данные о входе будут сохраняться в течение двух недель. При выходе из учетной записи куки входа будут удалены.\r\n\r\nПри редактировании или публикации статьи в браузере будет сохранен дополнительный куки, он не содержит персональных данных и содержит только ID записи отредактированной вами, истекает через 1 день.\r\n<h3>Встраиваемое содержимое других вебсайтов</h3>\r\nСтатьи на этом сайте могут включать встраиваемое содержимое (например видео, изображения, статьи и др.), подобное содержимое ведет себя так же, как если бы посетитель зашел на другой сайт.\r\n\r\nЭти сайты могут собирать ваши данные, использовать куки, внедрять дополнительное отслеживание третьей стороной и следить за вашим взаимодействием с внедренным содержимым, включая отслеживание взаимодействия, если у вас есть учетная запись и вы авторизовались на том сайте.\r\n<h3>Веб-аналитика</h3>\r\n<h2>С кем мы делимся вашими данными</h2>\r\n<h2>Как долго мы храним ваши данные</h2>\r\nЕсли вы оставляете комментарий, то сам комментарий и его метаданные сохраняются неопределенно долго. Это делается для того, чтобы определять и одобрять последующие комментарии автоматически, вместо помещения их в очередь на одобрение.\r\n\r\nДля пользователей с регистрацией на нашем сайте мы храним ту личную информацию, которую они указывают в своем профиле. Все пользователи могут видеть, редактировать или удалить свою информацию из профиля в любое время (кроме имени пользователя). Администрация вебсайта также может видеть и изменять эту информацию.\r\n<h2>Какие у вас права на ваши данные</h2>\r\nПри наличии учетной записи на сайте или если вы оставляли комментарии, то вы можете запросить файл экспорта персональных данных, которые мы сохранили о вас, включая предоставленные вами данные. Вы также можете запросить удаление этих данных, это не включает данные, которые мы обязаны хранить в административных целях, по закону или целях безопасности.\r\n<h2>Куда мы отправляем ваши данные</h2>\r\nКомментарии пользователей могут проверяться автоматическим сервисом определения спама.\r\n<h2>Ваша контактная информация</h2>\r\n<h2>Дополнительная информация</h2>\r\n<h3>Как мы защищаем ваши данные</h3>\r\n<h3>Какие принимаются процедуры против взлома данных</h3>\r\n<h3>От каких третьих сторон мы получаем данные</h3>\r\n<h3>Какие автоматические решения принимаются на основе данных пользователей</h3>\r\n<h3>Требования к раскрытию отраслевых нормативных требований</h3>', 'О сервисе', '', 'inherit', 'closed', 'closed', '', '3-revision-v1', '', '', '2018-07-05 13:50:26', '2018-07-05 10:50:26', '', 3, 'http://wp/2018/07/05/3-revision-v1/', 0, 'revision', '', 0),
